import React from "react";
import { TextField } from "@mui/material";

function Sender(){
    return (
        <TextField
            id="standard-multiline-flexible"
            label="Type a message"
            multiline
            maxRows={10}
            InputProps = {{
                style : {
                    borderColor : "red"
                }
            }}
            fullWidth="true"
            variant="standard"
      />
    )
}


export default Sender;
